import React from "react";
import { Slider, Stack } from '@mui/material';

const TuningPanel = ({ onUserChangeTuningData, TuningData }) => {
    return (
        <div style={{ paddingTop: "10px" }}>
            <Stack spacing={2} direction="row" sx={{ mb: 1 }} alignItems="center">
                <p>KP</p>
                <Slider
                    disabled={false}
                    marks={false}
                    step={0.1}
                    max={10}
                    min={1}
                    defaultValue={10}
                    size="small"
                    valueLabelDisplay="on"
                    onChange={onUserChangeTuningData}
                />

            </Stack>

            <Stack spacing={2} direction="row" sx={{ mb: 1 }} alignItems="center">
                <p>KD</p>
                <Slider
                    disabled={false}
                    marks={false}
                    step={0.1}
                    max={10}
                    min={1}
                    defaultValue={10}
                    size="small"
                    valueLabelDisplay="on"
                    onChange={onUserChangeTuningData}
                />
            </Stack>

        </div>
    )
}

export default TuningPanel;
